syntax = "proto3";
package fanxi;
import "RestfulBaseRequest.proto";
option java_package = "com.fanxi.service.message";
option java_outer_classname = "LoginAnonymousRequestProto";

message LoginAnonymousRequest {
   RestfulBaseRequest baseReq=1;
   string gcmId=20;
   int32 partnerId=21;
   string serverChallenge=22;
}
